import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
    return (
        <aside className="sidebar">
            <ul>
                <li><Link to="/">Dashboard</Link></li>
                <li><Link to="/api/transactions">Transactions</Link></li>
                <li><Link to="/api/reports">Reports</Link></li>
                <li><Link to="/api/goals">Goals</Link></li>
                <li><Link to="/api/budgets">Budgets</Link></li>
            </ul>
        </aside>
    );
};

export default Sidebar;
